import React, { Component } from 'react';

import Button from './compornents/Button';
import InputField from './compornents/InputField';
import Todo from './compornents/Task';

import style from './style.module.css';

class App extends Component {

  render() {
    return (
      <div>
        <InputField label="追加" />
        <hr />
        <Button label="完了" />
        <Button label="削除" />
        <ul>
          <li><Todo /></li>
        </ul>
      </div>
    );
  }
}

export default App;
